export default (function(a,b,c,d,e,f,g,h,i,j,k){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:g,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:g,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:5}}},gUnf1xUWjc:{data:{id:1402,attributes:{imdbId:"tt0252501",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNjFjNWNmYWUtZTFlMi00ZDcxLWJkY2MtNjMwYmM0OTc5OTM1XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"6.9\u002F10"},{Source:"Rotten Tomatoes",Value:"49%"},{Source:"Metacritic",Value:"55\u002F100"}],item_lang:{data:{id:2065,attributes:{title:e,plot:"This is a gentle, innocent movie about the reflections of an aging man (David Morse), who returns to his home town after the death of his best friend. Memories of life at age eleven floods back as it was a magical time that changed his life. Three eleven-year-old children, Bobby Garfield (Anton Yelchin), Carol Gerber (Mika Boorem), and John \"Sully\" Sullivan (Will Rothhaar), share their lives. Carol and Bobby have a special affection for one another including sharing a kiss \"by which all others will be measured\". Bobby lives with his mother Liz (Hope Davis), a bitter, vain woman who looks for pleasures for herself without sharing much with her son. Into their lives comes mysterious new boarder Ted Brautigan (Sir Anthony Hopkins), who befriends the boy, but generates distrust from the mother. As time passes, the man and boy share confidences, and special powers are revealed. The man warns the boy to be on the lookout for the \"Low Men\", who were seeking him. The two share a summer's adventures and come to love one another before the inevitable happens. A confrontation with a school bully also changes everyone.",slug:"hearts-in-atlantis"}}},books:{data:[{id:7489,attributes:{title:e,description:i,thumbnail:j,authors:[b],firstBook:true,published:k,publisher:c,subtitle:f}},{id:7490,attributes:{title:e,description:i,thumbnail:j,authors:[b],firstBook:d,published:k,publisher:c,subtitle:f}},{id:7491,attributes:{title:"Everything's Eventual",description:"A collection of short fiction features \"L.T.'s Theory of Pets,\" \"Lunch at the Gotham Cafâe,\" and \"In the Deathroom,\" as well as \"1408,\" about a writer whose stay in Room 1408 at the Dolphin Hotel turns his life upside down.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=XCMu2NrzCpwC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2007-05-01",publisher:c,subtitle:"14 Dark Tales"}},{id:7492,attributes:{title:"Stephen King, American Master",description:"Fascinating facts, trivia, and little-known details about the Master of the Macabre’s life from the “world’s leading authority on Stephen King” (Entertainment Weekly). New York Times–bestselling author Stephen Spignesi has compiled interviews, essays, and loads of facts and details about all of Stephen King’s work into this fun and informative compendium for the author’s many fans, from the casual to the fanatical! Did you know. . . ? In his early teens, Stephen King sold typed copies of his short stories at school. King originally thought his novel Pet Sematary was too frightening to publish. King’s legendary Dark Tower series took him more than 30 years to write. Thinner was the novel that revealed his “Richard Bachman” pseudonym to the world. King wrote The Eyes of the Dragon for his daughter Naomi. He has never liked Stanley Kubrick’s film version of his novel The Shining. It took him four years to write what some consider his magnum opus, IT. The 2017 film version of IT has grossed more than $700 million worldwide. In addition to novels, King has written essays, plays, screenplays, and even poetry.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=uMhyDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Stephen Spignesi"],firstBook:d,published:"2018-10-30",publisher:"Permuted Press+ORM",subtitle:"A Creepy Corpus of Facts About Stephen King & His Work"}},{id:7493,attributes:{title:"Stephen King Goes to the Movies",description:"A collection of five short stories that have been made into movies includes \"The Mangler,\" in which a skeptical writer investigates a supposedly haunted hotel room that has apparently caused at least forty-two deaths.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Qbm5ejIoY5sC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2009-01-20",publisher:c,subtitle:f}}]}}},meta:{}}},prerenderedAt:1681377335708}}("movie","Stephen King","Simon and Schuster",null,"Hearts in Atlantis","","series",1,"King mesmerizes readers with fiction deeply rooted in the sixties, exploring in five interconnected narratives, spanning 1960 to 1999, the haunting legacy of the Vietnam War. \"Engaging . . . King's gift of storytelling is rich\".--\"The Los Angles Times Book Review\".","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=7HA9DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2017-11-14"))